import React from "react"

function Footer(){
    return(
        <>
        <footer id="footer" className="page-footer blue-grey darken-4 white-text center">
        <p class="flow-text text-footer">Site &copy; 2021 </p>
        </footer>
    </>
    )
   
}

export default Footer
